import React from "react";
import './Paged.css';



export default function Paged({ pokePerPage, pokemons, paged }) {
  let pagedNumbers = [];
  for (let i = 1; i <= Math.ceil(pokemons / pokePerPage); i++) {
    pagedNumbers.push(i)
  }

  return (
    <div className="paged">
      <div className="lista">
        {pagedNumbers && pagedNumbers.map(number => (
            <p className="anchor" style={{background : url("https://th.bing.com/th/id/R.842555425a7843c73c9a9daf6cf736f4?rik=NlR%2bL3nuo1PZJQ&pid=ImgRaw&r=0")}} key={number} onClick={() => paged(number)}>{number}</p>
        ))}
      </div>
    </div>

  )
}
